import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <div className="navbar animate__animated animate__fadeInLeft animate__slower">
        <Link to="/">
          <h2>Workout Buddy</h2>
        </Link>
        <div className="right-nav">
          <ul>
            <li className="sign">Sign in</li>
            <li className="sign">Sign up</li>
          </ul>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
